import React from 'react';
import './App.css';
import Particles from 'react-particles-js';

const particleParams = {
  particles: {
          number: {
              value: 70,
              density: {
                  enable: true,
                  value_area: 1500
              }
          },
          line_linked: {
              enable: true,
              opacity: 0.035
          },
          move: {
              direction: "right",
              speed: 0.05
          },
          size: {
              value: 1
          },
          opacity: {
              anim: {
                  enable: true,
                  speed: 1.5,
                  opacity_min: 0.05
              }
          }
      },
      interactivity: {
          events: {
              onhover: {
                  enable: true,
                  mode: "repulse"
              }
          },
          modes: {
              repulse: {
                  distance: 30
              }
          }
      },
      retina_detect: true
}

const h1Style = {
  fontSize: '70px',
  textAlign: 'center',
  color: '#fffee0',
}

const h2Style = {
  fontSize: '50px',
  color: '#fffee0',
}

const divStyle = {
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center'
}


function App() {
  return (
    <>
      <div style = {divStyle}>
        <h2 style = {h2Style}>SKILLS</h2>
        <h2 style = {h2Style}>CONTACT</h2>
        <h1 style = {h1Style}>ELTON</h1>
        <h2 style = {h2Style}>PROJECTS</h2>
        <h2 style = {h2Style}>ART</h2>

      </div>
      <Particles params = {particleParams}/>
    </>

  );
}

export default App;
